import sys
from typing import List


class Solution:
    def minimumTime(self, time: List[int], totalTrips: int) -> int:

        def trip_counter(num):

            i = 0

            trips = 0

            while i < len(time):

                trips += num // time[i]
                i += 1
                if trips > totalTrips:
                    break

            return trips

        start = 1
        end = totalTrips * min(time)

        while start <= end:

            mid = (start + end) // 2

            trips = trip_counter(mid)

            if trips >= totalTrips:
                end = mid - 1

            else:
                start = mid + 1

        return start


def test_case1():
    time = [1, 2, 3]
    totalTrips = 5
    exp = 3
    assert Solution().minimumTime(time, totalTrips) == exp


def test_case2():
    time = [2]
    totalTrips = 1
    exp = 2
    assert Solution().minimumTime(time, totalTrips) == exp


